import React from "react";
import Styles from "./AboutClass.module.scss";

const AboutClass = () => {
	return (
		<div className="aboutClassWrapper">
			<div className="wrapperInner">
				<div className="title"></div>
			</div>
		</div>
	);
};
export default AboutClass;
